import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
      <form onSubmit={handleSubmit}>
        <input 
          type="text"
          value={name} />
        <input 
          type="tel"
          value={phone} />
        <input 
          type="email"
          value={email} />
        <input type="submit" />
      </form>
    </>
  );
};
